import React from "react";
import styled from "styled-components";


function Button() {

    const Button = styled.button`
        background : ${props => props.primary ? "palevioletred" : "transparent"};
        color: white;
        font-size: 1em;
        margin: 1em;
        padding: 0.25em 1em;
        border: 2px solid palevioletred;
        border-radius: 3px;
`;

  return (
    <div>
            <Button primary>
                Primary
            </Button>

            <Button>
                Normal
            </Button>
    </div>
  );
}

export default Button;
